def getCounties():

    f = open("counties.txt", "a")
    json_response = callApi("https://www.trackcorona.live/api/cities")

    counties = []

    data = json_response["data"]
    for item in data: 
        county = item["location"].split(",")[0]
        counties.append(county)

    return counties

def countryCodeToName(code): 
    code = code.upper()

    for country_code, name in countries: 
        if code == country_code: 
            return name 

def nameToCountryCode(country_name): 
    country_name = country_name.title()

    for country_code, name in countries: 
        if country_name == name: 
            return country_code 

    return None


